B.MO=new A.ba("I had come back to campus for my senior year a week-ish late, and my girlfriend wanted me to do a hackathon with her. She said she's worked with these twin engineers (then-sophomores at duke) who are great and us four together would make a great team. I was so so exhausted from catching up with school work and just wanted to \"chill\", but I gave it a go since it's only a weekend-long hackathon.",null,null,B.q,null)
B.MP=new A.ba('I was bored sophomore year and wanted to make a "Tinder for guessing market events" for one reason or another (if I recall, one of the reasons was that I simply did not have the skills), the team ended up building a webapp that helps people optimize their co-living experience on campus, off campus, during summer internship, etc. The idea came about when I was stuck (again due to lack of my capabilities) and the designer on the team (my girlfriend) floated the idea of a roommate-matching platform. I liked the idea mostly because I could tell building it would teach me so many things I had been wanting to learn about, but I also did zoom out and realized how much a struggle-topic co-living is to college students.',null,null,B.q,null)
B.MS=new A.ba(", nothing here for now!)",null,null,B.q,null)
B.MV=new A.ba("The level of recall she has on the people (producers, celebrities, staff, etc.) she's worked with throughout her whole career, how she's kept in touch with so many of them, and how she credits them before she lists out her accomplishments.",null,null,B.q,null)
